/// uuid : "64cb8ad893304b02b5093b4a44c05678"
/// img : ""
/// captchaEnabled : true
/// code : 200

class CaptchaEntity {
  CaptchaEntity({
      String? uuid, 
      String? img, 
      bool? captchaEnabled, 
      num? code,}){
    _uuid = uuid;
    _img = img;
    _captchaEnabled = captchaEnabled;
    _code = code;
}

  CaptchaEntity.fromJson(dynamic json) {
    _uuid = json['uuid'];
    _img = json['img'];
    _captchaEnabled = json['captchaEnabled'];
    _code = json['code'];
  }
  String? _uuid;
  String? _img;
  bool? _captchaEnabled;
  num? _code;
CaptchaEntity copyWith({  String? uuid,
  String? img,
  bool? captchaEnabled,
  num? code,
}) => CaptchaEntity(  uuid: uuid ?? _uuid,
  img: img ?? _img,
  captchaEnabled: captchaEnabled ?? _captchaEnabled,
  code: code ?? _code,
);
  String? get uuid => _uuid;
  String? get img => _img;
  bool? get captchaEnabled => _captchaEnabled;
  num? get code => _code;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['uuid'] = _uuid;
    map['img'] = _img;
    map['captchaEnabled'] = _captchaEnabled;
    map['code'] = _code;
    return map;
  }

}